import React from "react";
import "./App.css";

const Header = () => {
  const text = "Hello Iqboljon";
  return <h1>{text}</h1>;
};

const Fields = () => {
  const text = "Typing...";
  return (
    <>
      <input type="text" placeholder={text} />
    </>
  );
};

const Button = () => {
  const btnText = "Click";

  return <button>{btnText}</button>;
};

const App = () => {
  return (
    <div>
      <Header />
      <Fields />
    </div>
  );
};

export default App;
